    "Bird communities of coniferous forests in the Acadian region: their habitat associations
    and responses to forest management",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-05-28T01:48:28.263715",nt"name": "bird-communities-of-coniferous-forests-in-the-acadian-region-their-habitat-associations-an-900b7",nt"isopen":
    false,nt"url": null,nt"notes": "This annual report documents project activities
    for bird communities of coniferous forests in the Acadian Region. The objectives
    of this project are to: 1 quantify the composition and forest associations of coniferous
    bird communities in four silvicultural treatments representing a gradient in mature
    canopy residuals compared to mature softwood reference sites; 2 model the influences
    of silvicultural practices on coniferous forest bird communities; 3 use data at
    both landscape and local scales to determine important habitat and beneficial forest
    management practices; 4 provide accessible and interpretable results for forest
    managers that can be used to manage for avian species of concern in managed forest
    landscapes and stands.",nt"license_title": "License Not Specified",nt"extras":
